import { useContext, useState } from 'react';
import { AuthContext } from '../../contexts/auth';
import './styles.css';
import Axios from 'axios';

export const Dashboard = () => {
  const { logout } = useContext(AuthContext);

  const handleLogout = () => {
    logout();
  }

  const [values, setValues] = useState();

  const handleChangeValues = (value) => {
    setValues(prevValue => ({
      ...prevValue,
      [value.target.name]: value.target.value,
    }));
  };

  const handleClickButton = () => {
    Axios.post("http://localhost:3001/cadastrar", {
      nome: values.nome,
      email: values.email,
      telefone: values.telefone,
    });
  }

  return (
    <div className="conteudo">
      <div className="conteudo-clientes">
        <div className="conteudo-clientes-cabecalho">
          <h1 className="conteudo-clientes-cabecalho-titulo">Clientes</h1>
          <button className="botao-logout" onClick={handleLogout}>Sair</button>
        </div>

        <div className="conteudo-clientes-field">
          <input
            className="conteudo-clientes-input"
            type="text"
            name="nome"
            placeholder="Nome"
            onChange={handleChangeValues}
          />
          <input
            className="conteudo-clientes-input"
            type="email"
            name="email"
            placeholder="Email"
            onChange={handleChangeValues}
          />
          <input
            className="conteudo-clientes-input"
            type="text"
            name="telefone"
            placeholder="Telefone"
            onChange={handleChangeValues}
          />
          <button className="botao-cadastro" onClick={() => handleClickButton()}>Cadastrar</button>
        </div>
      </div>
    </div>
  );
}
